import { ThemeProvider } from "styled-components";
import { theme } from './constants/theme';
import RouteComponent from './routes/RouteComponent';

function App() {
  return (
    <ThemeProvider theme={theme}>
        <RouteComponent />
    </ThemeProvider>
  );
}

export default App;
